import ic_back_blue from "./ic_back_blue.png";
import ic_back_white from "./ic_back_white.png";
import ic_check from "./ic_check.png";
import ic_email from "./ic_email.png";
import ic_finger from "./ic_finger.png";
import ic_id from "./ic_id.png";
import ic_lock from "./ic_lock.png";
import ic_logout from "./ic_logout.png";
import ic_menu_blue from "./ic_menu_blue.png";
import ic_menu_white from "./ic_menu_white.png";
import ic_message from "./ic_message.png";
import ic_mobileNumber from "./ic_mobileNumber.png";
import ic_notification from "./ic_notification.png";
import ic_passport from "./ic_passport.png";
import ic_selfie from "./ic_selfie.png";
import ic_settings from "./ic_settings.png";

export const icons = {
  ic_back_blue,
  ic_back_white,
  ic_check,
  ic_email,
  ic_finger,
  ic_id,
  ic_lock,
  ic_logout,
  ic_menu_blue,
  ic_menu_white,
  ic_message,
  ic_mobileNumber,
  ic_notification,
  ic_passport,
  ic_selfie,
  ic_settings,
};

export default icons;
